import React from 'react'
import './Footer.css'



class Footer extends React.Component {


    render() {
        return (

            <div className='footer'>
                <p>Website designed and written by <a href="https://github.com/codethulu">codethulu</a> (Brendan Bell)</p>

            </div>


        );
    }
}
export default Footer;
